) - &#x60;66&#x60;: Von einem Dritten unterzeichneter Schuldschein (Zahlung durch ein unbedingtes schriftliches Versprechen eines Dritten an eine andere Person, das von dem Dritten unterzeichnet ist und in dem er sich verpflichtet, auf Verlangen oder zu einem festen oder bestimmbaren zukünftigen Zeitpunkt eine bestimmte Geldsumme an eine Bestellung oder an den Überbringer zu zahlen.) - &#x60;67&#x60;: Schuldschein, der von einer dritten Partei unterzeichnet und von einer Bank indossiert wurde (Zahlung durch ein unbedingtes schriftliches Versprechen eines Dritten an eine andere Person, das von dem Dritten unterzeichnet und von einer Bank indossiert ist und in dem er sich verpflichtet, auf Verlangen oder zu einem festgelegten oder bestimmbaren künftigen Zeitpunkt eine bestimmte Summe in Geld an eine Bestellung oder an den Inhaber zu zahlen.) - &#x60;68&#x60;: Online Zahlungsdienst (Die Zahlung erfolgt oder erfolgte über einen Online-Zahlungsdienst.) - &#x60;70&#x60;: Vom Gläubiger auf den Schuldner gezogener Wechsel (Wechsel, der vom Gläubiger auf den Schuldner gezogen wird.) - &#x60;74&#x60;: Vom Gläubiger auf eine Bank gezogener Wechsel (Vom Gläubiger auf eine Bank gezogener Wechsel.) - &#x60;75&#x60;: Vom Gläubiger gezogener Wechsel, indossiert von einer anderen Bank (Vom Gläubiger gezogener Wechsel, indossiert von einer anderen Bank.) - &#x60;76&#x60;: Wechsel, der vom Gläubiger auf eine Bank gezogen und von einer dritten Partei indossiert wurde (Wechsel, der vom Gläubiger auf eine Bank gezogen und von einer dritten Partei indossiert wurde.) - &#x60;77&#x60;: Vom Gläubiger auf einen Dritten gezogener Wechsel (Wechsel, der vom Gläubiger auf einen Dritten gezogen wird.) - &#x60;78&#x60;: Vom Gläubiger auf einen Dritten gezogener Wechsel, der von der Bank akzeptiert und indossiert wurde (Vom Gläubiger auf einen Dritten gezogener Wechsel, der von der Bank akzeptiert und indossiert wurde.) - &#x60;91&#x60;: Nicht übertragbare Bankschecks (Issue a bankers draft not endorsable.) - &#x60;92&#x60;: Nicht übertragbare lokale Schecks (Stellen Sie einen nicht indossierbaren Bankwechsel aus.) - &#x60;93&#x60;: Referenzgiro (Der auftraggebende Kunde weist die Bank an, das Zahlungssystem &#39;Referenzgiro&#39; zu verwenden. Wird im nationalen finnischen Bankensystem verwendet.) - &#x60;94&#x60;: Dringendes Girokonto (Der auftraggebende Kunde weist die Bank an, bei der Überweisung den Bankdienst &#39;Urgent Giro&#39; zu verwenden. Wird im nationalen finnischen Bankensystem verwendet.) - &#x60;95&#x60;: Freies Format giro (Der auftraggebende Kunde weist die auftraggebende Bank an, bei der Überweisung den Bankdienst &#39;Free Format Giro&#39; zu verwenden. Wird im nationalen finnischen Bankensystem verwendet.) - &#x60;96&#x60;: Gewünschte Zahlungsmethode wurde nicht verwendet (Wenn die angeforderte Zahlungsmethode nicht verwendet wurde oder werden konnte, zeigt dieser Code dies an.) - &#x60;97&#x60;: Clearing zwischen Partnern (Beträge, die sich zwei Partner gegenseitig zum Ausgleich schulden, um nutzlose Zahlungen zu vermeiden.) - &#x60;ZZZ&#x60;: Gegenseitig definiert (Ein Code, der innerhalb einer Codeliste zugewiesen wird, um übergangsweise und wie unter Handelspartnern definiert verwendet zu werden, bis ein genauer Code der Codeliste zugewiesen werden kann.)
